import React, { Fragment } from 'react';
import { Footer, NavBar, BackToTop, Legend } from './components';

const Layout: React.FC = ({ children }) => (
  <Fragment>
    <NavBar />
    <div>
    <Legend />
    {children}
    </div>
    <BackToTop />
    <Footer />
  </Fragment>
);

export default Layout;
